import ChatList from "../../Component/ChatList";
import Contents from "../../Component/Contents";
import FileOfMessages from "../../Component/FileOfMessages";
import "./apo.css";
import { useUser } from "../../hooks/useUser";
import { useState } from "react";

export default function ChatApp() {
  const { email, fullName, id } = useUser();
  const [selectedChatingUser , setSelectedChatingUser] = useState()


  return (
    <div className="Father">
      <div className="ComponentCommon">
        <ChatList fullName={fullName} />
        <Contents selectedChatingUser={selectedChatingUser} />
        <FileOfMessages />
      </div>
    </div>
  );
}
